import React from 'react'

export default function UserView({ r }) {
  return (
    <li className='user-view'>
        <div>
            Name: {r.name}
        </div>
        <div>
            E-mail: {r.email}
        </div>

        {/* {r.nodes} */}
    </li>
  )
}
